import React from 'react';
import { Route, Switch } from 'react-router-dom';  // Use { Routes, Route } for v6
import "./App.css"
import Home from './Components/Home'; // Replace with the correct path
import About from './Components/About'; // Replace with the correct path

function App() {
  return (
    <>
      <Switch> 
        <Route exact path='/' component={Home} /> 
        <Route path='/hero' component={About} /> 
      </Switch>  
    </>
  )
}

export default App;
